import './Components.css';

import imageLogo from './resources/bcnvisionlogo.png';

const VisionSystemConfPage = () => {
  return (
    <div id='panel' className="App-panel">
        <MainButton source={logopath} title={'Vision System Manager'} />
        <MainButton source={logopath} title={'Deep Learning Tools'} />
        <MainButton source={logopath} title={'Cortex Control Panel'} />
    </div>     
  );
}

export default VisionSystemConfPage;
